  false,\n\t\"url\": null,\n\t\"notes\": \"nThis data set contains monthly mean precipitation
  sums from Russian arctic stations. Precipitation measurements were acquired using
  a Tretyakov precipitation gauge. Data have not been adjusted for wind bias. Data
  from 1967 and later are corrected for wetting loss (this correction was made by
  observers as they recorded the station data). Precipitation measurements from 216
  stations are available. An analysis of existing precipitation data sets confirmed
  that data from these stations are not, at the time of publication, available in
  other commonly used precipitation data sets. Most data records begin in 1966 and
  end in 1990. The data are in tab-delimited ASCII format and available via FTP.n\",\n\t\"license_title\":
